import './App.css';
import Button from '@mui/material/Button';
import { Box } from '@mui/system';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
function App() {
  return (
    <header>
      <a href="">Employee Sheet</a>
      <Box>
        <Button variant="contained" color="secondary"> <PersonAddIcon className="mr-3"/> ADD NEW USER</Button>
      </Box>
    </header>
  );
}

export default App;
